import React from "react";
import Form from "./components/Form";

class App extends React.Component {
  constructor(props) {
    super(props);
    state = {
      counter: 0
    }
  }

  handleIncrement = () => {
    setInterval(this.setState(prevState => {
      return {
        count: prevState.count + 1
      }
    }), 1000)
  }

  render() {
    return (
      <>
        <h1>{this.state.count}</h1>
      </>
    )
  }
}

export default App;
